import { styled } from "styled-components"

const BotonIcono = styled.button`
    margin-left: 12px;
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: transparent;
    border: none;
    cursor: pointer;
    color: white;
`

export default BotonIcono
